import React from "react";

interface Props {
  name: string;
  ingredients: string;
  image?: any;
}

const Card = (props: Props) => {
  return (
    <div>
      <img src={props.image}></img>
      <h3>{props.name}</h3>
      <p>{props.ingredients}</p>
    </div>
  );
};

export default Card;
